options.onRender:
(() => {
  if (!htmlNode || !data || !data.series) return;

  const el = (q) => htmlNode.querySelector(q);
  const setText = (q, v) => { const n = el(q); if(n) n.innerHTML = v; };

  const last = (series) => {
    const n = series.fields.find(f => f.type === 'number');
    if (n && n.values.length) return n.values.get(n.values.length - 1);
    const s = series.fields.find(f => f.type === 'string');
    if (s && s.values.length) return s.values.get(s.values.length - 1);
    return null;
  };

  const findLastByName = (name) => {
    const s = data.series.find(x => x.name === name);
    return s ? last(s) : null;
  };

  const toNum = (v) => (isFinite(Number(v)) ? Number(v) : 0);

  const bps = (v) => {
    const x = Number(v ?? 0);
    if (!isFinite(x) || x < 0) return '0 b/s';
    const units = ['b/s','Kb/s','Mb/s','Gb/s','Tb/s'];
    let i=0, val=x;
    while (val >= 1024 && i < units.length-1){ val/=1024; i++; }
    return `${val.toFixed(val >= 100 ? 0 : val >= 10 ? 1 : 2)} ${units[i]}`;
  };

  const formatUptime = (bootTime) => {
    if (!bootTime) return '--';
    const now = Math.floor(Date.now() / 1000);
    const upSec = now - bootTime;
    const days = Math.floor(upSec / 86400);
    const hours = Math.floor((upSec % 86400) / 3600);
    const mins = Math.floor((upSec % 3600) / 60);
    if (days > 0) return `${days}d ${hours}h`;
    if (hours > 0) return `${hours}h ${mins}m`;
    return `${mins}m`;
  };

  const formatCertDays = (unixTime) => {
    if (!unixTime) return null;
    const now = Math.floor(Date.now() / 1000);
    const diff = unixTime - now;
    const days = Math.floor(diff / 86400);
    return days;
  };

  const updateClock = () => {
    const now = new Date();
    const h = String(now.getHours()).padStart(2, '0');
    const m = String(now.getMinutes()).padStart(2, '0');
    const s = String(now.getSeconds()).padStart(2, '0');
    setText('#clock', `${h}:${m}:${s}`);
  };
  updateClock();
  setInterval(updateClock, 1000);

  const rxRe = /^Incoming network traffic on (.+)$/i;
  const txRe = /^Outgoing network traffic on (.+)$/i;
  const rxErrRe = /^Incoming errors on (.+)$/i;
  const txErrRe = /^Outgoing errors on (.+)$/i;

  const byIf = new Map();
  const ensure = (ifn) => {
    if (!byIf.has(ifn)) byIf.set(ifn, { rx:0, tx:0, rxErr:0, txErr:0 });
    return byIf.get(ifn);
  };

  for (const s of data.series) {
    const name = s.name || '';
    let m;
    if ((m = name.match(rxRe))) ensure(m[1].trim()).rx = toNum(last(s));
    else if ((m = name.match(txRe))) ensure(m[1].trim()).tx = toNum(last(s));
    else if ((m = name.match(rxErrRe))) ensure(m[1].trim()).rxErr = toNum(last(s));
    else if ((m = name.match(txErrRe))) ensure(m[1].trim()).txErr = toNum(last(s));
  }

  const isWan = (n) => /^WAN($|[_-])/i.test(n);

  const items = [...byIf.entries()].map(([ifName, v]) => ({ ifName, ...v }));
  const wan = items.filter(x => isWan(x.ifName));
  const lan = items.filter(x => !isWan(x.ifName)).filter(x => !x.ifName.toLowerCase().startsWith('ovpns')).sort((a,b) => (b.rx+b.tx) - (a.rx+a.tx)).slice(0, 12);

  const errTotal = items.reduce((acc, x) => acc + x.rxErr + x.txErr, 0);

  const cpuIdle = toNum(findLastByName('CPU idle time'));
  const cpuUser = toNum(findLastByName('CPU user time'));
  const cpuSystem = toNum(findLastByName('CPU System time'));
  const cpuUsage = 100 - cpuIdle;
  const memAvail = toNum(findLastByName('Available memory (percent)'));
  const memUsage = 100 - memAvail;
  const memActive = toNum(findLastByName('Memory Active (percent)')) || 0;
  const memCached = toNum(findLastByName('Memory Cached (percent)')) || 0;
  const memBuffers = toNum(findLastByName('Memory Buffers (percent)')) || 0;
  const memWired = toNum(findLastByName('Memory Wired (percent)')) || 0;
  const memFree = toNum(findLastByName('Memory Free (percent)')) || 0;
  const diskFree = toNum(findLastByName('Free disk space on / (percentage)'));
  const diskUsage = 100 - diskFree;
  const swapFree = toNum(findLastByName('Free swap space in %'));
  const swapUsage = 100 - swapFree;
  const swapUsageAlert = swapUsage > 5;
  const procTotal = toNum(findLastByName('Number of processes'));
  const procRun = toNum(findLastByName('Number of running processes'));
  const bootTime = toNum(findLastByName('Host boot time'));
  const uptime = formatUptime(bootTime);
  const mbufUsage = toNum(findLastByName('MBUF Total Used (percent)'));
  const newVersion = findLastByName('New Version of pfSense Available');
  const certExpiry = toNum(findLastByName('Certificates Manager: earliest validTo'));
  const certDays = formatCertDays(certExpiry);
  const statesUsagePercentRaw = findLastByName('States Table Current (percent)');
  const statesCurrent = toNum(findLastByName('States Table Current'));
  const statesMax = toNum(findLastByName('States Table Max'));
  let statesUsagePercent = toNum(statesUsagePercentRaw);
  if (statesUsagePercent <= 0 && statesCurrent > 0 && statesMax > 0) statesUsagePercent = (statesCurrent / statesMax) * 100;
  const dhcpProblems = toNum(findLastByName('DHCP Failover Pool Problems'));
  const carpStatus = findLastByName('CARP Status');
  const carpExpected = findLastByName('Expected CARP Status');
  const ipsecStatus = findLastByName('IPsec Tunnel 1 VPN CIELO  Phase 1 Status');
  const ipsecEnabled = findLastByName('IPsec Tunnel 1 VPN CIELO Tunnel Enabled');

  const mkIfCard = (x) => {
    const total = x.rx + x.tx;
    const hasTraffic = total > 0;
    const hasErr = (x.rxErr + x.txErr) > 0;
    const adminStatus = findLastByName(`Interface ${x.ifName} Admin Status`);
    const adminDown = adminStatus && (String(adminStatus).toLowerCase().includes('down') || String(adminStatus) === '0');
    const linkStatus = findLastByName(`Interface ${x.ifName} Link Status`);
    const linkDown = linkStatus && (String(linkStatus).toLowerCase().includes('down') || String(linkStatus) === '0');
    let status = 'up', label = 'ONLINE';
    if (adminDown) { status = 'down'; label = 'ADMINISTRATIVELY DOWN'; }
    else if (linkDown) { status = 'down'; label = 'NO LINK'; }
    else if (hasErr) { status = 'warn'; label = 'WARNING'; }
    else if (!hasTraffic) { status = 'up'; label = 'IDLE - NO TRAFFIC'; }
    const rxPct = total > 0 ? Math.min((x.rx / total) * 100, 100) : 0;
    const txPct = total > 0 ? Math.min((x.tx / total) * 100, 100) : 0;
    return `<div class=\"interface-card ${status}\"><div class=\"interface-header\"><div class=\"interface-name\">${x.ifName}</div><div class=\"status-badge ${status}\">${label}</div></div><div class=\"traffic-row\"><span class=\"traffic-label\">⬇ INBOUND</span><span class=\"traffic-value\">${bps(x.rx)}</span></div><div class=\"progress-bar\"><div class=\"progress-fill in\" style=\"width:${rxPct.toFixed(1)}%\"></div></div><div class=\"traffic-row\"><span class=\"traffic-label\">⬆ OUTBOUND</span><span class=\"traffic-value\">${bps(x.tx)}</span></div><div class=\"progress-bar\"><div class=\"progress-fill out\" style=\"width:${txPct.toFixed(1)}%\"></div></div><div class=\"error-row ${hasErr ? 'has-error' : ''}\"><span>Errors IN/OUT:</span><span>${x.rxErr} / ${x.txErr}</span></div></div>`;
  };

  setText('#wan-interfaces', wan.map(mkIfCard).join(''));
  setText('#lan-interfaces', lan.map(mkIfCard).join(''));

  const gwRaw = findLastByName('Gateway Status Raw');
  const gwNames = ['WAN', 'GW_WAN_CTI', 'defualtvl', 'extranet_ctiGW2', 'extranet_sfzGW', 'GW_DMZ', 'intranet', 'srvsintranet'];
  const gw = gwNames.map(name => ({ name, status: findLastByName(`Gateway ${name} Status`), loss: findLastByName(`Gateway ${name} Packet  Loss`), rtt: findLastByName(`Gateway ${name} RTT`), stddev: findLastByName(`Gateway ${name} RTT Std Deviation`) })).filter(g => g.status != null);
  const gwOnline = gw.filter(g => { const s = String(g.status ?? '').trim().toLowerCase(); return s.includes('up') || s.includes('online') || s.includes('ok') || s === '0' || s === '0.0'; }).length;
  const gwTotal = gw.length;
  const gwStats = gw.reduce((acc, g) => { const s = (g.status ?? '').toString(); const isUp = (() => { const clean = s.trim().toLowerCase(); return clean.includes('up') || clean.includes('online') || clean.includes('ok') || clean === '0' || clean === '0.0'; })(); const lossNum = toNum((g.loss ?? '').toString().replace('%','')); const rttNum = toNum((g.rtt ?? '').toString().replace('ms','')); const stddevNum = toNum((g.stddev ?? '').toString().replace('ms','')); if (!isUp) acc.down++; else if (rttNum > 500) acc.down++; else if (lossNum >= 2 || stddevNum > 10 || rttNum > 200) acc.warn++; return acc; }, { down: 0, warn: 0 });

  const criticalSignals = [gwStats.down > 0, statesUsagePercent > 85, swapUsage > 10, mbufUsage > 90, cpuUsage > 90, memUsage > 90, diskUsage > 90, carpStatus && carpExpected && carpStatus !== carpExpected];
  const warningSignals = [gwStats.warn > 0, statesUsagePercent > 70, swapUsage > 5, mbufUsage > 80, cpuUsage > 80, memUsage > 80, diskUsage > 80, dhcpProblems > 0, errTotal > 100];
  let globalBadge = 'up', globalLabel = 'FIREWALL OK', globalColor = '#00e676';
  if (criticalSignals.some(Boolean)) { globalBadge = 'down'; globalLabel = 'FIREWALL CRITICAL'; globalColor = '#ff1744'; }
  else if (warningSignals.some(Boolean)) { globalBadge = 'warn'; globalLabel = 'FIREWALL DEGRADED'; globalColor = '#ffc107'; }

  const summaryHTML = `<div class=\"summary-item\" style=\"border-left:4px solid ${globalColor};background:rgba(255,255,255,0.03)\"><span class=\"summary-label\">Global Status</span><span class=\"summary-value\" style=\"color:${globalColor};font-weight:800\">${globalLabel}</span></div><div class=\"summary-item\"><span class=\"summary-label\">WANs Monitored</span><span class=\"summary-value\">${wan.length}</span></div><div class=\"summary-item\"><span class=\"summary-label\">Gateways</span><span class=\"summary-value\" style=\"color:${gwOnline < gwTotal ? '#ffc107' : '#00e676'}\">${gwOnline} / ${gwTotal}</span></div><div class=\"summary-item\"><span class=\"summary-label\">Total Errors</span><span class=\"summary-value\" style=\"color:${errTotal > 0 ? '#ff1744' : '#00e676'}\">${errTotal}</span></div><div class=\"summary-item\" style=\"margin-top:20px\"><span class=\"summary-label\">CPU Usage</span><span class=\"summary-value\" style=\"color:${cpuUsage > 90 ? '#ff1744' : cpuUsage > 80 ? '#ffc107' : '#00e676'}\">${cpuUsage.toFixed(1)}%</span></div><div class=\"summary-item\"><span class=\"summary-label\">Memory Usage</span><span class=\"summary-value\" style=\"color:${memUsage > 90 ? '#ff1744' : memUsage > 80 ? '#ffc107' : '#00e676'}\">${memUsage.toFixed(1)}%</span></div><div class=\"summary-item\"><span class=\"summary-label\">Disk Usage</span><span class=\"summary-value\" style=\"color:${diskUsage > 90 ? '#ff1744' : diskUsage > 80 ? '#ffc107' : '#00e676'}\">${diskUsage.toFixed(1)}%</span></div><div class=\"summary-item\"><span class=\"summary-label\">Swap Usage</span><span class=\"summary-value\" style=\"color:${swapUsage > 10 ? '#ff1744' : swapUsage > 5 ? '#ffc107' : '#00e676'}\">${swapUsage.toFixed(1)}%</span></div><div class=\"summary-item\" style=\"margin-top:20px;border:2px solid ${statesUsagePercent > 85 ? '#ff1744' : statesUsagePercent > 70 ? '#ffc107' : '#2196f3'}\"><span class=\"summary-label\">States Table Usage</span><span class=\"summary-value\" style=\"color:${statesUsagePercent > 85 ? '#ff1744' : statesUsagePercent > 70 ? '#ffc107' : '#00e676'}; font-size:18px\">${statesUsagePercent.toFixed(1)}%</span></div><div class=\"summary-item\"><span class=\"summary-label\">Uptime</span><span class=\"summary-value\">${uptime}</span></div><div class=\"summary-item\"><span class=\"summary-label\">Processes</span><span class=\"summary-value\">${procRun} / ${procTotal}</span></div>`;
  setText('#summary', summaryHTML);

  const gwSummaryHTML = `<div class=\"summary-item\"><span class=\"summary-label\">Gateways Online</span><span class=\"summary-value\" style=\"color:${gwOnline < gwTotal ? '#ffc107' : '#00e676'}\">${gwOnline} / ${gwTotal}</span></div><div class=\"summary-item\"><span class=\"summary-label\">Raw Status</span><span class=\"summary-value\" style=\"font-size:10px\">${gwRaw ?? '--'}</span></div>`;
  setText('#gateway-summary', gwSummaryHTML);

  const mkGwCard = (g) => { const s = (g.status ?? '').toString(); const isUp = (() => { const clean = s.trim().toLowerCase(); return clean.includes('up') || clean.includes('online') || clean.includes('ok') || clean === '0' || clean === '0.0'; })(); const lossNum = toNum((g.loss ?? '').toString().replace('%','')); const rttNum = toNum((g.rtt ?? '').toString().replace('ms','')); const stddevNum = toNum((g.stddev ?? '').toString().replace('ms','')); let badge = 'up', label = 'ONLINE'; if (!isUp) { badge='down'; label='OFFLINE'; } else if (rttNum > 500) { badge='down'; label='CRITICAL LATENCY'; } else if (lossNum >= 2 || stddevNum > 10 || rttNum > 200) { badge='warn'; label='DEGRADED'; } const lossTxt = g.loss == null ? '--' : (typeof g.loss === 'number' ? `${g.loss.toFixed(1)}%` : String(g.loss)); const rttTxt = g.rtt == null ? '--' : (typeof g.rtt === 'number' ? `${g.rtt.toFixed(1)} ms` : String(g.rtt)); const stddevTxt = g.stddev == null ? '--' : (typeof g.stddev === 'number' ? `${g.stddev.toFixed(1)} ms` : String(g.stddev)); return `<div class=\"gateway-card ${badge}\" style=\"${badge === 'down' && label === 'CRITICAL LATENCY' ? 'border:3px solid #ff1744;box-shadow:0 0 10px rgba(255,23,68,0.5)' : ''}\"><div class=\"gateway-header\"><div class=\"interface-name\">GW ${g.name}</div><div class=\"status-badge ${badge}\">${label}</div></div><div class=\"metric-row\"><span class=\"metric-label\">Packet Loss</span><span class=\"metric-value\" style=\"color:${lossNum > 2 ? '#ff1744' : '#00e676'}\">${lossTxt}</span></div><div class=\"metric-row\"><span class=\"metric-label\">RTT</span><span class=\"metric-value\" style=\"color:${rttNum > 500 ? '#ff1744' : rttNum > 200 ? '#ffc107' : '#00e676'}\">${rttTxt}</span></div><div class=\"metric-row\"><span class=\"metric-label\">Jitter (stddev)</span><span class=\"metric-value\" style=\"color:${stddevNum > 10 ? '#ffc107' : '#888'}\">${stddevTxt}</span></div></div>`; };
  setText('#gateways', gw.map(mkGwCard).join(''));

  const ovpnRe = /^OpenVPN Server (.+) Clients Connected$/i;
  const ovpnStatusRe = /^OpenVPN Server (.+) Tunnel Status$/i;
  const ovpnServers = [];
  const ovpnStatusInfo = (v) => {
    const s = String(v ?? '').trim().toLowerCase();
    if (!s) return { level: 'down', isUp: false, label: 'UNKNOWN' };
    if (s.includes('up') || s.includes('connected') || s.includes('ok') || s.includes('listening')) return { level: 'up', isUp: true, label: 'UP' };
    if (s.includes('reconnecting')) return { level: 'warn', isUp: false, label: 'RECONNECTING' };
    if (s.includes('waiting')) return { level: 'warn', isUp: false, label: 'WAITING' };
    if (s.includes('down') || s.includes('disconnected') || s.includes('fail')) return { level: 'down', isUp: false, label: 'DOWN' };
    const n = Number(s);
    if (isFinite(n)) {
      if (n === 0) return { level: 'down', isUp: false, label: 'DOWN' };
      if (n === 1) return { level: 'up', isUp: true, label: 'UP' };
      if (n === 2) return { level: 'warn', isUp: false, label: 'NONE' };
      if (n === 3) return { level: 'warn', isUp: false, label: 'RECONNECTING' };
      if (n === 4) return { level: 'warn', isUp: false, label: 'WAITING' };
      if (n === 5) return { level: 'up', isUp: true, label: 'UP/LISTENING' };
      return { level: n > 0 ? 'up' : 'down', isUp: n > 0, label: n > 0 ? 'UP' : 'DOWN' };
    }
    return { level: 'down', isUp: false, label: 'UNKNOWN' };
  };
  for (const s of data.series) { const name = s.name || ''; const m = name.match(ovpnRe); if (!m) continue; const serverName = m[1].trim(); const clients = toNum(last(s)); const statusSeries = data.series.find(x => x.name === `OpenVPN Server ${serverName} Tunnel Status`); const tunnelStatus = statusSeries ? last(statusSeries) : null; ovpnServers.push({ serverName, clients, tunnelStatus }); }
  ovpnServers.sort((a,b) => b.clients - a.clients);
  const totalClients = ovpnServers.reduce((acc,x)=>acc+x.clients,0);
  const tunnelsUp = ovpnServers.filter(x => ovpnStatusInfo(x.tunnelStatus).isUp).length;
  const vpnSummaryHTML = `<div class="summary-item"><span class="summary-label">Total VPN Clients</span><span class="summary-value" style="color:#2196f3">${totalClients}</span></div><div class="summary-item"><span class="summary-label">Tunnels UP</span><span class="summary-value">${tunnelsUp} / ${ovpnServers.length}</span></div>`;
  setText('#vpn-summary', vpnSummaryHTML);

  const mkOvpnCard = (o) => { const info = ovpnStatusInfo(o.tunnelStatus); let badge='down', label='DOWN'; if (info.level === 'warn') { badge='warn'; label=info.label; } else if (info.isUp) { if (o.clients > 0) { badge='up'; label='ACTIVE'; } else { badge='warn'; label='IDLE'; } } const tunnelLabel = info.label === 'UNKNOWN' ? (o.tunnelStatus ?? 'unknown') : info.label + (o.tunnelStatus == null ? '' : ' (' + o.tunnelStatus + ')'); return `<div class="ovpn-card"><div class="ovpn-header"><div class="ovpn-name">${o.serverName}</div><div class="status-badge ${badge}">${label}</div></div><div class="client-count">${o.clients}</div><div style="text-align:center;font-size:10px;color:#888;margin-top:5px">CONNECTED CLIENTS</div><div style="text-align:center;font-size:9px;color:#666;margin-top:3px">Tunnel: ${tunnelLabel}</div></div>`; };
  const topOvpn = ovpnServers;
  setText('#ovpn-servers', topOvpn.length ? topOvpn.map(mkOvpnCard).join('') : '<div style="text-align:center;color:#888;padding:20px">No VPN servers</div>');


  const alerts = [];
  if (swapUsageAlert) { const severity = swapUsage > 10 ? 'critical' : 'warn'; alerts.push({ severity, msg: `Swap usage detected: ${swapUsage.toFixed(1)}% - Memory pressure!` }); }
  if (statesUsagePercent > 85) { alerts.push({ severity: 'critical', msg: `STATES TABLE CRITICAL: ${statesUsagePercent.toFixed(1)}% - Risk of connection drops!` }); } else if (statesUsagePercent > 70) { alerts.push({ severity: 'warn', msg: `States table usage high: ${statesUsagePercent.toFixed(1)}% - Monitor closely` }); }
  if (newVersion && String(newVersion).toLowerCase() !== 'no') { alerts.push({ severity: 'warn', msg: `pfSense update available: ${newVersion}` }); }
  if (certDays !== null && certDays < 30) { alerts.push({ severity: certDays < 7 ? 'critical' : 'warn', msg: `Certificate expires in ${certDays} days` }); }
  if (mbufUsage > 80) { alerts.push({ severity: 'critical', msg: `MBUF usage critical: ${mbufUsage.toFixed(1)}%` }); }
  if (dhcpProblems > 0) { alerts.push({ severity: 'warn', msg: `DHCP Failover issues: ${dhcpProblems}` }); }
  if (carpStatus && carpExpected && carpStatus !== carpExpected) { alerts.push({ severity: 'critical', msg: `CARP status mismatch: ${carpStatus} (expected ${carpExpected})` }); }
  if (ipsecStatus && ipsecEnabled !== '1') { const st = String(ipsecStatus).toLowerCase(); if (!st.includes('up') && !st.includes('connected')) { alerts.push({ severity: 'warn', msg: `IPsec VPN CIELO: ${ipsecStatus}` }); } }
  if (errTotal > 100) { alerts.push({ severity: 'warn', msg: `High interface errors: ${errTotal} total` }); }
  const alertsHTML = alerts.length === 0 ? '<div class=\"summary-item\" style=\"background:#1a3a1a\"><span class=\"summary-label\">System Status</span><span class=\"summary-value\" style=\"color:#00e676\">ALL OK</span></div>' : alerts.map(a => { const color = a.severity === 'critical' ? '#ff1744' : '#ffc107'; return `<div class=\"summary-item\" style=\"border-left:3px solid ${color}\"><span class=\"summary-label\" style=\"color:${color}\">${a.severity.toUpperCase()}</span><span class=\"summary-value\" style=\"font-size:10px;color:#fff\">${a.msg}</span></div>`; }).join('');
  setText('#alerts', alertsHTML);
})();
